import Button from '../components/Button';

export default function Pricing() {
  return (
    <div className="p-10">
      <h1 className="text-4xl font-bold text-center mb-8">Our Pricing</h1>
      <div className="flex flex-wrap justify-center gap-6">
        {[
          { name: 'Starter', price: '$99', features: ['Basic Setup', '1 Year Warranty'] },
          { name: 'Business', price: '$199', features: ['Full Setup', '3 Year Warranty', 'Monitoring'] },
          { name: 'Enterprise', price: '$299', features: ['All Features', '5 Year Warranty', '24/7 Support'] }
        ].map((plan, i) => (
          <div key={i} className="border p-6 rounded-lg shadow w-72 text-center bg-white">
            <h2 className="text-2xl font-semibold">{plan.name}</h2>
            <p className="text-3xl my-4">{plan.price}</p>
            <ul className="text-left mb-4 list-disc list-inside">
              {plan.features.map((f, idx) => <li key={idx}>{f}</li>)}
            </ul>
            <Button className="bg-yellow-500 text-white w-full">Choose Plan</Button>
          </div>
        ))}
      </div>
    </div>
  );
}
